description:
Prepare your sunglasses! This time Championship series takes you to the sunny beaches, marinas full of luxury yachts and lakes somewhere in the middle of forests. 

Choose one of available Jet Skis and become a king of the speed. Compete with AI or your friends in 3 beautiful sceneries of Monaco, Australia and California. 

4 game modes: Single Race, Championship, Time Attack and Local Multiplayer will test your skills and deliver tons of fun.

Features:

3 beautiful and challenging locations: Monaco, Australia, California;
12 tracks;
4 game modes: Single Race, Championships, Time Attack, Local Multiplayer;
Real Jet Ski experience;
High quality graphics and sounds;
Realistic driving model

